uy_ev_incentive_included`, `rent_to_buy_ownership_transfer_notes`, `top_pick`, `ideal_for_family`, `pickup`, `dropup`, `free_cancellation`, `collision_damage_waiver`, `theft_protection`, `unlimited_mileage`, `vehicle_features`, `daily_rate_tax_incl`, `weekly_rate_tax_incl`, `monthly_rate_tax_incl`) VALUES
('a00c0d1f-42d1-4ae4-905e-8a446e00d7fb', NULL, 'Mini', 'Toyota', 1, 10.00, 'Aygo X', 'Hatchback', '2023', 'Red', 'Automatic', 3, 'CAR001', NULL, NULL, NULL, NULL, NULL, '[{\"title\":\"Child Seat\",\"price\":\"20.00\",\"description\":\"This seat is designe\",\"interval\":\"daily\"},{\"title\":\"Bluetooth\",\"price\":\"20.00\",\"description\":\"Bluetooth\",\"interval\":\"weekly\"}]', 'The Toyota Aygo X is a compact urban crossover that builds on the legacy of the Toyota Aygo city car, but with a more rugged, SUV-inspired design. It was introduced as the next-generation model of the Aygo, with a focus on providing a fun, stylish, and pr', 'TEST001', NULL, 'TEST001', NULL, NULL, NULL, 'Each car has a daily mileage limit; unused miles do not roll over. Excess mileage is charged at the per‑mile rate on return.', '[{\"level\":\"basic\",\"cover\":\"Basic insurance\",\"cover_descr\":\"<div>What it is:<\\/div><div>Basic insurance is automatically included in your rental price. It provides the minimum level of cover required by law in the UK and Europe.<\\/div><div><br><\\/div><div>What\\u2019s covered:<\\/div><div><span style=\\\"white-space: normal;\\\">\\u2705 Third-Party Liability (TPL): covers damage or injury caused to other people, vehicles, or property while driving the hire car.<\\/span><\\/div><div><span style=\\\"white-space: normal;\\\">\\u2705 Collision Damage Waiver (CDW): limits your financial responsibility for damage to the rental vehicle, excluding tyres, glass, underbody, and interior.<\\/span><\\/div><div><span style=\\\"white-space: normal;\\\">\\u2705 Theft Protection (TP): limits your liability if the vehicle is stolen.<\\/span><\\/div><div><br><\\/div><div>What\\u2019s not covered:<\\/div><div><span style=\\\"white-space: normal;\\\">\\u274c Damage to tyres, wheels, glass, underbody, roof, or interior.<\\/span><\\/div><div><span style=\\\"white-space: normal;\\\">\\u274c Lost keys, misfuelling, or driver negligence.<\\/span><\\/div><div><span style=\\\"white-space: normal;\\\">\\u274c Personal belongings.<\\/span><\\/div><div><span style=\\\"white-space: normal;\\\">\\u274c Any damage not reported at the time of incident or caused by unauthorised use.<\\/span><\\/div><div><br><\\/div><div>Your responsibility:<\\/div><div>You remain liable up to the excess amount shown in your rental agreement (for example, \\u00a31,000\\u2013\\u00a32,500 depending on the vehicle). This means you pay up to that amount for any damage or theft, even if not your fault.<\\/div><div><br><\\/div>\",\"daily_price\":\"11\",\"excess\":\"11\"}]', '<div>ANI MOTORS – CAR HIRE TERMS &amp; CONDITIONS (v1.0, 2025-10-06)</div><div><br></div><div>1) Who you contract with</div><div>You are booking with ANI Motors Ltd (“we/us”). When you pay on booking, you are paying ANI Motors as merchant of record. When you pay at pick-up, a pre-authorisation (“deposit hold”) is placed on your card.</div><div><br></div><div>2) Driver requirements</div><div>• Minimum age and licence tenure per car class (see listing). Under- or over‑age fees may apply.</div><div>• Valid full driving licence held for the minimum months shown; International Driving Permit if required.</div><div>• Primary driver must present the payment card used to place the deposit hold, and a government photo ID/passport.</div><div>• Additional drivers must be present with their licences; fees may apply per day.</div><div><br></div><div>3) What your price includes</div><div>• VAT and mandatory third‑party liability. Collision Damage Waiver (CDW) and Theft Protection (TP) are included unless stated.</div><div>• Daily mileage allowance as shown on your car. Excess mileage is charged at the per‑mile/ km rate shown.</div><div>• Roadside assistance for mechanical breakdown (not driver fault).</div><div><br></div><div>4) What’s not included</div><div>• Fuel/charging costs (see Fuel/Battery policy), road/bridge/tunnel tolls, congestion/ULEZ charges, parking charges, traffic/PCN fines, speeding fines, and related admin fees (£30 per PCN).</div><div>• Damage or breakdown due to driver negligence (e.g., misfueling, curb/tyre damage, interior damage, off‑road use) and any key/charging cable loss.</div><div>• Optional extras (child seats, GPS, additional driver, cross‑border, out‑of‑hours, young driver fees) as listed on the car page.</div><div><br></div><div>5) Deposit &amp; excess</div><div>• A refundable security deposit hold is taken at pick-up on a credit card in the main driver’s name. We accept major credit/debit cards; cash not accepted.</div><div>• In case of damage/theft, the customer is liable up to the excess shown on the listing unless reduced by purchasing optional excess protection (if offered).</div><div><br></div><div>6) Identification &amp; payment</div><div>• Bring the same card you used for the booking (or an equivalent card in the main driver’s name). Virtual/ prepaid cards may be refused for deposits.</div><div>• We may require proof of address (utility bill/bank statement &lt; 90 days) for UK residents.</div><div><br></div><div>7) Mileage policy</div><div>• Each car has a daily mileage limit; unused miles do not roll over. Excess mileage is charged at the per‑mile rate on return.</div><div><br></div><div>8) Fuel / Battery policy</div><div>• “Full‑to‑Full”: pick up full, return full. Missing fuel is charged at pump price + £0.50/litre service.</div><div>• EVs must be returned with at least 60% battery (unless otherwise shown). Top‑up fee £0.50 per % below threshold + any DC charging cost.</div><div><br></div><div>9) Grace period &amp; late returns</div><div>• Grace period is as shown (typically 29 minutes). After that, late return fee per started hour applies. Returns &gt; 3 hours late may be charged as an extra rental day at the day rate + fees.</div><div><br></div><div>10) Cleanliness &amp; smoking</div><div>• No smoking or vaping. Excessive dirt, sand, pet hair or odour may incur a cleaning fee as shown on the listing.</div><div><br></div><div>11) Cross‑border travel</div><div>• Only permitted if the listing states “cross-border allowed” and the fee is paid. Written prior approval is required. Some countries are excluded.</div><div><br></div><div>12) Cancellation / no‑show policy</div><div>• Flexible: free cancellation until the “free cancellation until hours” shown before pick‑up; after that, 1 rental day is charged.</div><div>• Semi‑Flexible: free cancellation until the hours shown; after that, 50% of the rental is charged.</div><div>• Non‑Refundable: 100% charged on booking; no refund on cancellation or no‑show.</div><div>• No‑show: if you fail to arrive with required documents/ card within 2 hours of pick‑up time, the booking may be cancelled and charges per plan apply.</div><div><br></div><div>13) Modifications</div><div>• Changes are subject to availability and may affect the price. If the change reduces the rental value, standard cancellation charges may apply to the unused portion.</div><div><br></div><div>14) Fines, PCNs &amp; administration</div><div>• You are responsible for all traffic/parking offences. We will transfer liability where possible and charge a £30 admin fee per notice. For tolls we may charge the toll + admin fee.</div><div><br></div><div>15) Accidents &amp; incidents</div><div>• In any incident: stop safely; call emergency services if needed; report to us immediately; do not admit liability; obtain third‑party details and photos. A full report must be submitted within 24 hours.</div><div>• Failure to report may void cover and you may be liable for full costs.</div><div><br></div><div>16) Breakdown</div><div>• Call the provided roadside number. Call‑out caused by driver error (e.g., keys locked in, out of charge/fuel, flat battery due to accessories) is chargeable at cost.</div><div><br></div><div>17) Vehicle use restrictions</div><div>• No off‑road use, track days, towing (unless authorised), or ride‑hailing/ courier work unless authorised in writing. Commercial/private‑hire use r