uy_ev_incentive_included`, `rent_to_buy_ownership_transfer_notes`, `top_pick`, `ideal_for_family`, `pickup`, `dropup`, `free_cancellation`, `collision_damage_waiver`, `theft_protection`, `unlimited_mileage`, `vehicle_features`, `daily_rate_tax_incl`, `weekly_rate_tax_incl`, `monthly_rate_tax_incl`) VALUES
('a010c336-af5f-4cfc-bc6d-79a62cb69036', NULL, 'kia', 'Kia', 1, 10.00, 'Sportage', 'Sedan', '2023', 'White', 'Automatic', 5, 'AM0004', NULL, NULL, NULL, NULL, NULL, '[{\"title\":\"Additional driver\",\"price\":\"50\",\"description\":\"If you also want other people to drive\",\"interval\":\"daily\"},{\"title\":\"Booster seat\",\"price\":\"10\",\"description\":\"For bigger children: 18\\u201345 kg\\/40\\u2013100 lbs (about 4\\u201311 years old)\",\"interval\":\"daily\"},{\"title\":\"Infant car seat\",\"price\":\"28\",\"description\":\"For babies: up to 9 kg\\/20 lbs (about 1 year old)\",\"interval\":\"daily\"},{\"title\":\"GPS\",\"price\":\"26\",\"description\":\"A satellite navigation device that provides directions\",\"interval\":\"daily\"}]', 'Kia offers stylish, reliable, and efficient cars designed for comfort, safety, and everyday family use.', 'TEST004', NULL, 'TEST004', NULL, NULL, NULL, '<p><span style=\"color: rgb(26, 26, 26); font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif;\">If you drive more than&nbsp;</span><span style=\"color: rgb(26, 26, 26); font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif;\">500</span><span style=\"color: rgb(26, 26, 26); font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif;\">&nbsp;</span><span style=\"color: rgb(26, 26, 26); font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif;\">miles</span><span style=\"color: rgb(26, 26, 26); font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif;\">&nbsp;during your rental, you\'ll pay&nbsp;</span><span style=\"color: rgb(26, 26, 26); font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif;\">£0.30</span><span style=\"color: rgb(26, 26, 26); font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif;\">&nbsp;for each additional&nbsp;</span><span style=\"color: rgb(26, 26, 26); font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif;\">mile</span><span style=\"color: rgb(26, 26, 26); font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif;\">&nbsp;when you drop your car off.</span><br></p>', '[{\"level\":\"basic\",\"cover\":\" Basic Insurance\",\"cover_descr\":\"<p>Basic insurance is automatically included in your rental price. It provides the minimum level of cover required by law in the UK and Europe.<\\/p><p><br><\\/p><p>What\\u2019s covered:<\\/p><p><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2705 Third-Party Liability (TPL): covers damage or injury caused to other people, vehicles, or property while driving the hire car.<\\/span><\\/p><p><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2705 Collision Damage Waiver (CDW): limits your financial responsibility for damage to the rental vehicle, excluding tyres, glass, underbody, and interior.<\\/span><\\/p><p><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2705 Theft Protection (TP): limits your liability if the vehicle is stolen.<\\/span><\\/p><p><br><\\/p><p>What\\u2019s not covered:<\\/p><p><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u274c Damage to tyres, wheels, glass, underbody, roof, or interior.<\\/span><\\/p><p><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u274c Lost keys, misfuelling, or driver negligence.<\\/span><\\/p><p><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u274c Personal belongings.<\\/span><\\/p><p><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u274c Any damage not reported at the time of incident or caused by unauthorised use.<\\/span><\\/p><p><br><\\/p><p>Your responsibility:<\\/p><p>You remain liable up to the excess amount shown in your rental agreement (for example, \\u00a31,000\\u2013\\u00a32,500 depending on the vehicle). This means you pay up to that amount for any damage or theft, even if not your fault.<\\/p><div><br><\\/div>\",\"daily_price\":\"16\",\"excess\":\"2000\"},{\"level\":\"full\",\"cover\":\" Full Insurance\",\"cover_descr\":\"<div>What it is:<\\/div><div>A comprehensive cover upgrade that significantly reduces your financial risk and offers broader protection for the vehicle.<\\/div><div><br><\\/div><div>What\\u2019s covered (in addition to Basic):<\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2705 All Basic coverage (TPL, CDW, TP)<\\/span><\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2705 Windscreen, tyres, mirrors, locks, and glass coverage<\\/span><\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2705 Key loss, towing, and roadside recovery for non-mechanical issues<\\/span><\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2705 Vandalism and weather damage<\\/span><\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2705 Minor scratches, dents, and paintwork (subject to fair usage)<\\/span><\\/div><div><br><\\/div><div>Your responsibility:<\\/div><div>Excess is reduced or waived entirely depending on plan chosen (e.g., \\u00a30 excess option).<\\/div><div><br><\\/div><div>Important:<\\/div><div>Full Insurance does not cover unauthorised use, off-road driving, or use under the influence of drugs\\/alcohol.<\\/div><div><br><\\/div>\",\"daily_price\":\"20\",\"excess\":\"2500\"},{\"level\":\"excess\",\"cover\":\"Excess Protection\",\"cover_descr\":\"<div>What it is:<\\/div><div>A supplemental product that reimburses you for any deductible\\/excess you may be charged if the car is damaged or stolen.<\\/div><div><br><\\/div><div>How it works:<\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>You still leave a deposit hold at pick-up.<\\/span><\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>If ANI Motors charges you part or all of your excess after damage, you can claim it back through Excess Protection.<\\/span><\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>It\\u2019s ideal for travellers who want to limit unexpected costs but keep the Basic cover.<\\/span><\\/div><div><br><\\/div><div>Covered items (depending on provider):<\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2705 Excess on damage\\/theft up to a limit (e.g. \\u00a33,000)<\\/span><\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2705 Tyres, glass, underbody, roof<\\/span><\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2705 Towing &amp; admin fees<\\/span><\\/div><div><br><\\/div><div>Not covered:<\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u274c Negligence or contract breach<\\/span><\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u274c Loss of personal items<\\/span><\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u274c Any unreported incident<\\/span><\\/div><div><br><\\/div>\",\"daily_price\":\"30\",\"excess\":\"3000\"}]', '<h4 class=\"bui-f-font-heading\" style=\"font-size: 16px; line-height: 24px; font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; margin-block: 0px 0.67em; color: rgb(var(--bui_color_black)); letter-spacing: normal;\"><div style=\"box-sizing: inherit; margin-bottom: 16px;\">Important information</div></h4><div style=\"box-sizing: inherit; color: rgb(26, 26, 26); font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif; margin: 8px 0px;\"><div style=\"box-sizing: inherit;\"><div style=\"box-sizing: inherit; margin: 8px 0px;\"><div style=\"box-sizing: inherit;\"><div style=\"box-sizing: inherit; margin: 8px 0px;\"><div style=\"box-sizing: inherit;\"><div style=\"box-sizing: inherit; margin: 8px 0px;\"><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px;\">By making this booking, you’re confirming that you have read and accept the rental terms.<br style=\"box-sizing: inherit;\"><br style=\"box-sizing: inherit;\">At the rental counter, customers will also sign a rental agreement before they give you the key. It’s important that you read that agreement carefully - and if anything isn’t clear, discuss it with the counter staff before you sign.</p><div style=\"box-sizing: inherit;\"></div></div></div></div><div style=\"box-sizing: inherit; margin: 8px 0px;\"><div style=\"box-sizing: inherit;\"><div style=\"box-sizing: inherit; margin: 8px 0px;\"><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px;\">You rental company reserves the right to refuse a car if, in the counter staff’s opinion, the driver is unfit to drive or anyone in the group is threatening, abusive or in any way endangering the health and safety of other people. If this happens, you will not be entitled to any refund or compensation.</p><div style=\"box-sizing: inherit;\"></div></div><div style=\"box-sizing: inherit; margin: 8px 0px;\"><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px;\">Please see ‘What you need at pick-up’ above - and note that the counter staff will not provide a car unless all requirements (age, driving licence, payment card, documentation, etc.) are met. If this happens, you will not be entitled to any refund or compensation.</p><div style=\"box-sizing: inherit;\"></div></div><div style=\"box-sizing: inherit; margin: 8px 0px;\"><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px;\">Before you drive off, you must check the car and make sure that any damage is reported to the counter staff and noted on the rental agreement. Otherwise, you may end up being liable for that damage.</p><div style=\"box-sizing: inherit;\"></div></div></div></div></div></div><h5 class=\"SM_b8de4613 bui-f-font-strong\" style=\"box-sizing: inherit; font-size: 14px; line-height: 20px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; margin-block-end: 0.67em; font-family: var(--DO_NOT_USE_bui_small_font_strong_2_font-family) !important;\"><div style=\"box-sizing: inherit; margin-bottom: 16px;\">Road rules</div></h5><div style=\"box-sizing: inherit; margin: 8px 0px;\"><div style=\"box-sizing: inherit;\"><div style=\"box-sizing: inherit; margin: 8px 0px;\"><div style=\"box-sizing: inherit;\"><div style=\"box-sizing: inherit; margin: 8px 0px;\"><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px;\"></p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px;\">When you rent a car, you are agreeing to use it responsibly. You must not:</p><ul style=\"box-sizing: inherit;\"><li style=\"box-sizing: inherit;\">drive under the influence of alcohol, drugs, or any other type of narcotic substances</li><li style=\"box-sizing: inherit;\">transport any inflammable or dangerous goods, or any toxic, corrosive, radioactive or otherwise harmful substances</li><li style=\"box-sizing: inherit;\">carry anything which, because of its smell and/or condition, could damage the car or cause the rental company to lose time or money</li><li style=\"box-sizing: inherit;\">transport live animals</li><li style=\"box-sizing: inherit;\">install a roof rack, luggage carrier or anything similar, unless supplied by the rental company</li><li style=\"box-sizing: inherit;\">rent the car to anyone else</li><li style=\"box-sizing: inherit;\">carry passengers for hire or reward (taxi)</li><li style=\"box-sizing: inherit;\">participate in rallies, competitions or trials</li><li style=\"box-sizing: inherit;\">give driving lessons</li><li style=\"box-sizing: inherit;\">tow another vehicle</li><li style=\"box-sizing: inherit;\">travel on unpaved roads or roads where the surface or state of repair could damage the car</li><li style=\"box-sizing: inherit;\">in any way break the highway code, road traffic laws or other laws.</li></ul><p></p><div style=\"box-sizing: inherit;\"></div></div><div style=\"box-sizing: inherit; margin: 8px 0px;\"><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px;\">Seatbelt - Whatever country you’re driving in, driver and passengers must wear seatbelts if fitted, wherever they’re sitting in the car.</p><div style=\"box-sizing: inherit;\"></div></div><div style=\"box-sizing: inherit; margin: 8px 0px;\"><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px;\">Please be aware that all cars have a non-smoking policy. Fines will apply if this policy is not adhered to.</p><div style=\"box-sizing: inherit;\"></div></div><div style=\"box-sizing: inherit; margin: 8px 0px;\"><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px;\">To make sure you understand the rules and laws about driving hire cars at home and abroad, it’s essential you read the Terms &amp; Conditions in full before you leave to pick your car up.<br style=\"box-sizing: inherit;\"><br style=\"box-sizing: inherit;\">In particular, please make sure you know what documents and other paperwork you must take with you (e.g. driving licence, forms of identification, and payment cards) and what you’ll need to pay for at the car hire counter. If you don’t have everything you need, the car hire company may not let you pick the car up.</p><div style=\"box-sizing: inherit;\"></div></div><div style=\"box-sizing: inherit; margin: 8px 0px;\"><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px;\">If you intend to do any city driving, there may be traffic restrictions based on your car’s licence plate, so please tell the counter staff when you go to pick up your car.</p><div style=\"box-sizing: inherit;\"></div></div></div></div></div></div><h5 class=\"SM_b8de4613 bui-f-font-strong\" style=\"box-sizing: inherit; font-size: 14px; line-height: 20px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; margin-block-end: 0.67em; font-family: var(--DO_NOT_USE_bui_small_font_strong_2_font-family) !important;\"><div style=\"box-sizing: inherit; margin-bottom: 16px;\">On the road</div></h5><div style=\"box-sizing: inherit; margin: 8px 0px;\"><div style=\"box-sizing: inherit;\"><div style=\"box-sizing: inherit; margin: 8px 0px;\"><div style=\"box-sizing: inherit;\"><div style=\"box-sizing: inherit; margin: 8px 0px;\"><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px;\">Accident or Breakdown - In the event of a breakdown, accident or mechanical difficulties, you must call the car hire company immediately. They must give authority for repairs or replacement cars. Please keep copies of all documentation you are asked to complete. This may be needed if you wish to make a claim. For accidents, a police report and an incident report from the car hire counter will be required.</p><div style=\"box-sizing: inherit;\"></div></div><div style=\"box-sizing: inherit; margin: 8px 0px;\"><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px;\">If you are having any problems with your rental car, please call the rental company.</p><div style=\"box-sizing: inherit;\"></div></div></div></div></div></div></div></div><h4 class=\"bui-f-font-heading\" style=\"font-size: 16px; line-height: 24px; font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; margin-block-end: 0.67em; color: rgb(var(--bui_color_black)); letter-spacing: normal;\"><div style=\"box-sizing: inherit; margin-bottom: 16px;\">Car Hire Company Important Information</div></h4><div style=\"box-sizing: inherit; color: rgb(26, 26, 26); font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif; margin: 8px 0px;\"><div style=\"box-sizing: inherit;\"><h5 class=\"SM_b8de4613 bui-f-font-strong\" style=\"box-sizing: inherit; font-size: 14px; line-height: 20px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; margin-block: 0px 0.67em; font-family: var(--DO_NOT_USE_bui_small_font_strong_2_font-family) !important;\"><div style=\"box-sizing: inherit; margin-bottom: 16px;\">Price calculation</div></h5><div style=\"box-sizing: inherit; margin: 8px 0px;\"><div style=\"box-sizing: inherit;\"><div style=\"box-sizing: inherit; margin: 8px 0px;\"><div style=\"box-sizing: inherit;\"><div style=\"box-sizing: inherit; margin: 8px 0px;\"><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px;\">Please note that exchange rates can fluctuate - and no-one in the car rental industry can do anything about this. As a result, you might find that charges on your statement aren’t an exact match with the price you were told while booking. The same goes for any refund you may receive.</p><div style=\"box-sizing: inherit;\"></div></div><div style=\"box-sizing: inherit; margin: 8px 0px;\"><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px;\">Price Calculation - Prices are based on the pick-up and drop-off times and dates that you agree before your rental starts. If you pick the car up any later or bring it back any earlier, you will not receive a refund for unused time.</p><div style=\"box-sizing: inherit;\"></div></div><div style=\"box-sizing: inherit; margin: 8px 0px;\"><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px;\">If, at pick-up, you choose to take a different car, there may be an additional charge for this – even if the new car is smaller than the one you had booked.</p><div style=\"box-sizing: inherit;\"></div></div></div></div></div></div><h5 class=\"SM_b8de4613 bui-f-font-strong\" style=\"box-sizing: inherit; font-size: 14px; line-height: 20px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; margin-block-end: 0.67em; font-family: var(--DO_NOT_USE_bui_small_font_strong_2_font-family) !important;\"><div style=\"box-sizing: inherit; margin-bottom: 16px;\">Penalty fees</div></h5><div style=\"box-sizing: inherit; margin: 8px 0px;\"><div style=\"box-sizing: inherit;\"><div style=\"box-sizing: inherit; margin: 8px 0px;\"><div style=\"box-sizing: inherit;\"><div style=\"box-sizing: inherit; margin: 8px 0px;\"><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px;\">An Immobilisation Charge is payable in the event of an accident. This is in addition to the amount deducted from the excess and is compulsory. This charge is calculated against the car group and the number of repair days.</p><div style=\"box-sizing: inherit;\"></div></div><div style=\"box-sizing: inherit; margin: 8px 0px;\"><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px;\">Lost Keys - If you lose your key(s), you will be charged the cost of replacement.</p><div style=\"box-sizing: inherit;\"></div></div><div style=\"box-sizing: inherit; margin: 8px 0px;\"><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px;\">If you\'ve not returned the car after your agreed drop-off time, the insurance will no longer be valid. Plus, you will be charged a penalty fee as well as the cost of another day\'s rental.</p><div style=\"box-sizing: inherit;\"></div></div><div style=\"box-sizing: inherit; margin: 8px 0px;\"><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px;\">Fine for late return: £25.00</p><div style=\"box-sizing: inherit;\"></div></div></div></div></div></div><h5 class=\"SM_b8de4613 bui-f-font-strong\" style=\"box-sizing: inherit; font-size: 14px; line-height: 20px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; margin-block-end: 0.67em; font-family: var(--DO_NOT_USE_bui_small_font_strong_2_font-family) !important;\"><div style=\"box-sizing: inherit; margin-bottom: 16px;\">Grace period</div></h5><div style=\"box-sizing: inherit; margin: 8px 0px;\"><div style=\"box-sizing: inherit;\"><div style=\"box-sizing: inherit; margin: 8px 0px;\"><div style=\"box-sizing: inherit;\"><div style=\"box-sizing: inherit; margin: 8px 0px;\"><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px;\">You must be at the rental counter by your pick-up time: if you’re late, the car may no longer be available, and you won’t be entitled to a refund. If you think you might be late, it\'s vital that you contact the rental company at least 30 minutes before your pick-up time, even if it\'s because of a flight delay and you’ve provided your flight number.</p><div style=\"box-sizing: inherit;\"></div></div><div style=\"box-sizing: inherit; margin: 8px 0px;\"><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px;\">Please note that the car hire company will hold your car for the indicated grace period ONLY during office opening hours. If you are late and you arrive at the location after the car hire company closes, you will not be able to collect your vehicle and cancellation charges will apply.</p><div style=\"box-sizing: inherit;\"></div></div><div style=\"box-sizing: inherit; margin: 8px 0px;\"><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px;\">There will be a 29-minute grace period for the return of all vehicles. If the car is returned after this time the insurance will no longer be valid and the customer will have to pay the late penalty fee + the daily rate.</p><div style=\"box-sizing: inherit;\"></div></div><div style=\"box-sizing: inherit; margin: 8px 0px;\"><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px;\">In case of delay, reservations will be held for 59 minutes from the specified reservation time, after which they will be classed as a no-show.</p><div style=\"box-sizing: inherit;\"></div></div></div></div></div></div><h5 class=\"SM_b8de4613 bui-f-font-strong\" style=\"box-sizing: inherit; font-size: 14px; line-height: 20px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; margin-block-end: 0.67em; font-family: var(--DO_NOT_USE_bui_small_font_strong_2_font-family) !important;\"><div style=\"box-sizing: inherit; margin-bottom: 16px;\">Valeting</div></h5><div style=\"box-sizing: inherit; margin: 8px 0px;\"><div style=\"box-sizing: inherit;\"><div style=\"box-sizing: inherit; margin: 8px 0px;\"><div style=\"box-sizing: inherit;\"><div style=\"box-sizing: inherit; margin: 8px 0px;\"><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px;\">The car hire company will charge you if the car needs more than a reasonable amount of cleaning after your rental.</p><div style=\"box-sizing: inherit;\"></div></div></div></div></div></div></div></div><h4