<span style=\"color: rgb(26, 26, 26); font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif;\">).</span><span style=\"color: rgb(26, 26, 26); font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif;\">This cover is only valid if you stick to the terms of the rental agreement. It doesn\'t cover other parts of the car (e.g. windows, wheels, interior or undercarriage), or charges (e.g. for towing or off-road time), or anything in the car (e.g. child seats, GPS devices or personal belongings).</span><br></p>', '<div class=\"SM_b8de4613\" style=\"box-sizing: inherit; flex-shrink: 0; margin-block: 0px; margin-inline: 0px; font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif; line-height: var(--bui_font_body_2_line-height); color: rgb(26, 26, 26);\">At pick-up, the main driver will leave a refundable security deposit of&nbsp;£1,500.00&nbsp;on their&nbsp;credit card. Cash and debit cards are not accepted. The counter staff will confirm how much this will be.</div><div style=\"box-sizing: inherit; flex-shrink: 0; margin-block: 0px; margin-inline: 0px; color: rgb(26, 26, 26); font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif;\"><h4 class=\"SM_f48a68a6\" style=\"box-sizing: inherit; font-size: var(--bui_font_strong_2_font-size); line-height: var(--bui_font_strong_2_line-height); font-weight: var(--bui_font_strong_2_font-weight); font-family: var(--bui_font_strong_2_font-family); margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; margin-block: 0px 0.67em;\">Accepted cards</h4><div class=\"SM_f06d4876\" style=\"padding: var(--bui_box_padding); --bui_box_padding: calc(var(--bui_box_spaced_padding--s)*var(--bui_spacing_1x)); --bui_box_spaced_padding--s: 0.5;\"><ul class=\"SM_09a54643 SM_7987f9c6\" style=\"box-sizing: inherit; margin-block-end: 0px; p