('a0125495-7844-404b-9f2c-6bcb8fefb82c', NULL, 'maruti suzuki 800', 'BMW', 1, 10.00, '1 Series', 'Coupes', '2008', 'RED', 'Automatic', 4, 'ABC1234', NULL, NULL, NULL, NULL, NULL, '[{\"title\":\"Additional driver\",\"price\":\"200\",\"description\":\"If you want other people to drive as well\",\"interval\":\"daily\"},{\"title\":\"Baby seat\",\"price\":\"200\",\"description\":\"For babies: up to 9 kg \\/ 20 lbs (about 1 year old)\",\"interval\":\"daily\"},{\"title\":\"GPS\",\"price\":\"100\",\"description\":\"A satellite navigation (sat nav) device that provides directions\",\"interval\":\"daily\"},{\"title\":\"Child booster seat\",\"price\":\"100\",\"description\":\"For bigger children: 18-45 kg \\/ 40-100 lbs (about 4-11 years old)\",\"interval\":\"daily\"}]', 'The Maruti 800 is an iconic, budget-friendly hatchback manufactured by Maruti Suzuki from 1983 to 2013, known for its small size, simple design, and ease of maintenance, making it a symbol of India\'s economic growth. It features a 796cc engine', 'ABC1234', NULL, 'ABC1234', NULL, NULL, NULL, '<div class=\"PM_b848800a PM_aaf76dc0 PM_8321412c PM_6e9e6a44\" style=\"box-sizing: inherit; --bui_stack_height: initial; display: flex; padding: 0px; list-style-type: none; height: auto; margin: 0px; flex-flow: row; align-items: flex-start; gap: 8px; flex-grow: 0; --bui_stack_gap: calc(2*4px); color: rgb(26, 26, 26); font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif; --bui_stack_spaced_gap--s: 2;\"><div class=\"PM_1ce69267 PM_bdeacff3\" style=\"box-sizing: inherit; flex: 1 1 100%; margin-block: 0px; margin-inline: 0px;\"><div class=\"PM_b8de4613\" style=\"box-sizing: inherit; line-height: 20px;\">Your rental includes unlimited free&nbsp;kilometres.</div><div><br></div></div></div>', '[{\"level\":\"excess\",\"cover\":\"Excess Protectio\",\"cover_descr\":\"<div>What it is:<\\/div><div>A supplemental product that reimburses you for any deductible\\/excess you may be charged if the car is damaged or stolen.<\\/div><div><br><\\/div><div>How it works:<\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>You still leave a deposit hold at pick-up.<\\/span><\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>If ANI Motors charges you part or all of your excess after damage, you can claim it back through Excess Protection.<\\/span><\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>It\\u2019s ideal for travellers who want to limit unexpected costs but keep the Basic cover.<\\/span><\\/div><div><br><\\/div><div>Covered items (depending on provider):<\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2705 Excess on damage\\/theft up to a limit (e.g. \\u00a33,000)<\\/span><\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2705 Tyres, glass, underbody, roof<\\/span><\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2705 Towing &amp; admin fees<\\/span><\\/div><div><br><\\/div><div>Not covered:<\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u274c Negligence or contract breach<\\/span><\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u274c Loss of personal items<\\/span><\\/div><div><span style=\\\"w