"box-sizing: inherit; height: auto; transition: height 0.24s cubic-bezier(0, 0, 0.4, 1); color: rgb(26, 26, 26); font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif; overflow: initial;\"><div aria-labelledby=\":r16:-label\" class=\"PM_b0a5729e\" style=\"box-sizing: inherit; padding-block-start: 16px;\"><div style=\"box-sizing: inherit; margin: 8px 0px;\"><div style=\"box-sizing: inherit;\"><h4 class=\"bui-f-font-heading\" style=\"font-size: 16px; line-height: 24px; margin-right: 0px; margin-bottom: 0.67em; margin-left: 0px; padding: 0px; margin-block: 0px 0.67em; color: rgb(26, 26, 26); font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif !important;\"><div style=\"box-sizing: inherit; margin-bottom: 16px;\">Insurance, Covers and Waivers</div></h4><div style=\"box-sizing: inherit; margin: 8px 0px;\"><div style=\"box-sizing: inherit;\"><h5 class=\"PM_b8de4613 bui-f-font-strong\" style=\"box-sizing: inherit; font-size: 14px; line-height: 20px; font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif; margin-right: 0px; margin-bottom: 0.67em; margin-left: 0px; padding: 0px; margin-block: 0px 0.67em;\"><div style=\"box-sizing: inherit; margin-bottom: 16px;\">Insurance Information</div></h5><div style=\"box-sizing: inherit; margin: 8px 0px;\"><div style=\"box-sizing: inherit;\"><div style=\"box-sizing: inherit; margin: 8px 0px;\"><div style=\"box-sizing: inherit;\"><div style=\"box-sizing: inherit; margin: 8px 0px;\"><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px;\">Insurance information<br style=\"box-sizing: inherit;\">All rental cars must have Collision Damage Waiver (CDW) and Theft Protection (TP). Each policy will be either:</p><ul style=\"box-sizing: inherit;\"><li style=\"box-sizing: inherit;\">included or</li><li style=\"box-sizing: inherit;\">purchasable from the rental company, or</li><li style=\"box-sizing: inherit;\">provided by another company (e.g. your credit card company).</li></ul><p></p><div style=\"box-sizing: inherit;\"></div></div></div></div></div></div><h5 class=\"PM_b8de4613 bui-f-font-strong\" style=\"box-sizing: inherit; font-size: 14px; line-height: 20px; font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif; margin-right: 0px; margin-bottom: 0.67em; margin-left: 0px; padding: 0px; margin-block-end: 0.67em;\"><div style=\"box-sizing: inherit; margin-bottom: 16px;\">Collision Damage Waiver (CDW)</div></h5><div style=\"box-sizing: inherit; margin: 8px 0px;\"><div style=\"box-sizing: inherit;\"><div style=\"box-sizing: inherit; margin: 8px 0px;\"><div style=\"box-sizing: inherit;\"><div style=\"box-sizing: inherit; margin: 8px 0px;\"><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px;\">If the car’s bodywork gets damaged, the most you’ll pay towards repairs covered by the Collision Damage Waiver is the damage excess. This cover is only valid if you stick to the terms of the rental agreement. It doesn’t cover other parts of the car (e.g. glass, wheels, interior, roof or undercarriage), or charges (e.g. for towing or off-road time), or anything in the car (e.g. child seats, GPS devices or personal belongings).</p><div style=\"box-sizing: inherit;\"></div></div></div></div></div></div><h5 class=\"PM_b8de4613 bui-f-font-strong\" style=\"box-sizing: inherit; font-size: 14px; line-height: 20px; font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif; margin-right: 0px; margin-bottom: 0.67em; margin-left: 0px; padding: 0px; margin-block-end: 0.67em;\"><div style=\"box-sizing: inherit; margin-bottom: 16px;\">Theft Cover</div></h5><div style=\"box-sizing: inherit; margin: 8px 0px;\"><div style=\"box-sizing: inherit;\"><div style=\"box-sizing: inherit; margin: 8px 0px;\"><div style=\"box-sizing: inherit;\"><div style=\"box-sizing: inherit; margin: 8px 0px;\"><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px;\">If the car is stolen, the most you’ll pay towards replacement costs covered by the policy is the theft excess. This cover is only valid if you stick to the terms of the rental agreement.</p><div style=\"box-sizing: inherit;\"></div></div></div></div></div></div><h5 class=\"PM_b8de4613 bui-f-font-strong\" style=\"box-sizing: inherit; font-size: 14px; line-height: 20px; font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif; margin-right: 0px; margin-bottom: 0.67em; margin-left: 0px; padding: 0px; margin-block-end: 0.67em;\"><div style=\"box-sizing: inherit; margin-bottom: 16px;\">Third-Party Liability (TPL)</div></h5><div style=\"box-sizing: inherit; margin: 8px 0px;\"><div style=\"box-sizing: inherit;\"><div style=\"box-sizing: inherit; margin: 8px 0px;\"><div style=\"box-sizing: inherit;\"><div style=\"box-sizing: inherit; margin: 8px 0px;\"><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px;\">Covers the driver’s liability for any injuries and property damage that are included in the policy. It does not cover injuries to the driver or damage to the rental car. This cover is only valid if you stick to the terms of the rental agreement.</p><div style=\"box-sizing: inherit;\"></div></div></div></div></div></div><h5 class=\"PM_b8de4613 bui-f-font-strong\" style=\"box-sizing: inherit; font-size: 14px; line-height: 20px; font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif; margin-right: 0px; margin-bottom: 0.67em; margin-left: 0px; padding: 0px; margin-block-end: 0.67em;\"><div style=\"box-sizing: inherit; margin-bottom: 16px;\">Loss or Damage</div></h5><div style=\"box-sizing: inherit; margin: 8px 0px;\"><div style=\"box-sizing: inherit;\"><div style=\"box-sizing: inherit; margin: 8px 0px;\"><div style=\"box-sizing: inherit;\"><div style=\"box-sizing: inherit; margin: 8px 0px;\"><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px;\">If the car is stolen, or seriously damaged, or damaged in an incident involving someone else, please contact the rental company and the police immediately. If you can\'t provide the necessary documents from the police, you\'ll be liable for the full cost of replacing/repairing the car. If the car gets slightly damaged, and no-one else is involved, please contact the rental company immediately.</p><div style=\"box-sizing: inherit;\"></div></div><div style=\"box-sizing: inherit; margin: 8px 0px;\"><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px;\">The rental company is not liable for the loss of / theft of / damage to any belongings in the car, during or after the rental.</p><div style=\"box-sizing: inherit;\"></div></div><div style=\"box-sizing: inherit; margin: 8px 0px;\"><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px;\">Damage to the car will be charged for by the car hire company after it is dropped off - and will incur a Damage Administration fee on top of the amount deducted from the excess.</p><div style=\"box-sizing: inherit;\"></div></div><div style=\"box-sizing: inherit; margin: 8px 0px;\"><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px;\">Not included in the rental cover (CDW &amp; TP)<br style=\"box-sizing: inherit;\">Loss of / theft of / damage to: keys, aerials, jack, safety triangles and vests, windscreen wipers, petrol cap, luggage covers, or any other fixed or mobile component of the car.<br style=\"box-sizing: inherit;\"></p><div style=\"box-sizing: inherit;\"></div></div></div></div></div></div></div></div><h4 class=\"bui-f-font-heading\" style=\"font-size: 16px; line-height: 24px; margin-right: 0px; margin-bottom: 0.67em; margin-left: 0px; padding: 0px; margin-block-end: 0.67em; color: rgb(26, 26, 26); font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif !important;\"><div style=\"box-sizing: inherit; margin-bottom: 16px;\">Mileage / Kilometres</div></h4><div style=\"box-sizing: inherit; margin: 8px 0px;\"><div style=\"box-sizing: inherit;\"><div style=\"box-sizing: inherit; margin: 8px 0px;\"><div style=\"box-sizing: inherit;\"><div style=\"box-sizing: inherit; margin: 8px 0px;\"><div style=\"box-sizing: inherit;\"><div style=\"box-sizing: inherit; margin: 8px 0px;\"><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px;\">Your rental includes unlimited free kilometres.</p><div style=\"box-sizing: inherit;\"></div></div></div></div><div style=\"box-sizing: inherit; margin: 8px 0px;\"><div style=\"box-sizing: inherit;\"><div style=\"box-sizing: inherit; margin: 8px 0px;\"><p style=\"box-sizing: inherit; margin-right: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px;\">Changing the length of your rental can affect how many kilometres you can drive for free. It can also affect how much you will pay for each additional kilometre.</p></div></div></div></div></div></div></div></div></div></div></div>', '<p><span style=\"color: rgb(26, 26, 26); font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif;\">If the car\'s bodywork gets damaged, the most you\'ll pay towards repairs covered by the Collision Damage Waiver is the damage excess (</span><span style=\"color: rgb(26, 26, 26); font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif;\">£1,505.00</span><span style=\"color: rgb(26, 26, 26); font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif;\">).</span><span style=\"color: rgb(26, 26, 26); font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif;\">This cover is only valid if you stick to the terms of the rental agreement. It doesn\'t cover other parts of the car (e.g. windows, wheels, interior or undercarriage), or charges (e.g. for towing or off-road time), or anything in the car (e.g. child seats, GPS devices or personal belongings).</span></p>', '<div class=\"PM_b8de4613\" style=\"box-sizing: inherit; flex-shrink: 0; margin-block: 0px; margin-inline: 0px; line-height: 20px; font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif; color: rgb(26, 26, 26);\">At pick-up, the main driver will leave a refundable security deposit of&nbsp;£1,505.00&nbsp;on their&nbsp;credit card. Cash and debit cards are not accepted. The counter staff will confirm how much this will be.</div><div style=\"box-sizing: inherit; flex-shrink: 0; margin-block: 0px; margin-inline: 0px; color: rgb(26, 26, 26); font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif;\"><h4 class=\"PM_f48a68a6\" style=\"box-sizing: inherit; font-size: 14px; line-height: 20px; font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif; margin-right: 0px; margin-bottom: 0.67em; margin-left: 0px; padding: 0px; margin-block: 0px 0.67em;\">Accepted cards</h4><div class=\"PM_f06d4876\" style=\"padding: 2px; --bui_box_padding: calc(0.5*4px); --bui_box_spaced_padding--s: 0.5;\"><ul class=\"PM_09a54643 PM_7987f9c6\" style=\"box-sizing: inherit; padding-inline: 0px 16px; margin-block-end: 0px;\"><li class=\"PM_b362