('a012d78e-9310-48b6-8149-c0fd2b41449f', NULL, 'Mercedes-Benz', 'Mercedes-Benz', 1, 10.00, 'E-Class', 'Convertibles', '2023', 'Silver', 'Automatic', 4, 'AM0006', NULL, NULL, NULL, NULL, NULL, '[{\"title\":\"Additional driver\",\"price\":\"28\",\"description\":\"If you also want other people to drive\",\"interval\":\"daily\"},{\"title\":\"Booster seat\",\"price\":\"26\",\"description\":\"For bigger children: 18\\u201345 kg\\/40\\u2013100 lbs (about 4\\u201311 years old)\",\"interval\":\"daily\"},{\"title\":\"Infant car seat\",\"price\":\"28\",\"description\":\"For babies: up to 9 kg\\/20 lbs (about 1 year old)\",\"interval\":\"daily\"},{\"title\":\"GPS\",\"price\":\"28\",\"description\":\"A satellite navigation device that provides directions\",\"interval\":\"daily\"}]', 'Mercedes-Benz is a German automobile manufacturer founded in 1926, renowned for producing luxury vehicles, trucks, and buses with a rich history of innovation and a commitment to engineering excellence. \n', 'TEST006', NULL, 'TEST006', NULL, NULL, NULL, '<p><span style=\"color: rgb(26, 26, 26); font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif;\">If you drive more than&nbsp;</span><span style=\"color: rgb(26, 26, 26); font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif;\">500</span><span style=\"color: rgb(26, 26, 26); font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif;\">&nbsp;</span><span style=\"color: rgb(26, 26, 26); font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif;\">miles</span><span style=\"color: rgb(26, 26, 26); font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif;\">&nbsp;during your rental, you\'ll pay&nbsp;</span><span style=\"color: rgb(26, 26, 26); font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif;\">£0.30</span><span style=\"color: rgb(26, 26, 26); font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif;\">&nbsp;for each additional&nbsp;</span><span style=\"color: rgb(26, 26, 26); font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif;\">mile</span><span style=\"color: rgb(26, 26, 26); font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif;\">&nbsp;when you drop your car off.</span><br></p>', '[{\"level\":\"basic\",\"cover\":\"Basic Insurance\",\"cover_descr\":\"<p>What it is:<\\/p><p>Basic insurance is automatically included in your rental price. It provides the minimum level of cover required by law in the UK and Europe.<\\/p><p><br><\\/p><p>What\\u2019s covered:<\\/p><p><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2705 Third-Party Liability (TPL): covers damage or injury caused to other people, vehicles, or property while driving the hire car.<\\/span><\\/p><p><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2705 Collision Damage Waiver (CDW): limits your financial responsibility for damage to the rental vehicle, excluding tyres, glass, underbody, and interior.<\\/span><\\/p><p><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2705 Theft Protection (TP): limits your liability if the vehicle is stolen.<\\/span><\\/p><p><br><\\/p><p>What\\u2019s not covered:<\\/p><p><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u274c Damage to tyres, wheels, glass, underbody, roof, or interior.<\\/span><\\/p><p><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u274c Lost keys, misfuelling, or driver negligence.<\\/span><\\/p><p><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u274c Personal belongings.<\\/span><\\/p><p><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u274c Any damage not reported at the time of incident or caused by unauthorised use.<\\/span><\\/p><p><br><\\/p><p>Your responsibility:<\\/p><p>You remain liable up to the excess amount shown in your rental agreement (for example, \\u00a31,000\\u2013\\u00a32,500 depending on the vehicle). This means you pay up to that amount for any damage or theft, even if not your fault.<\\/p><div><br><\\/div>\",\"daily_price\":\"10\",\"excess\":\"2000\"},{\"level\":\"full\",\"cover\":\"Full Insurance\",\"cover_descr\":\"<div>What it is:<\\/div><div>A comprehensive cover upgrade that significantly reduces your financial risk and offers broader protection for the vehicle.<\\/div><div><br><\\/div><div>What\\u2019s covered (in addition to Basic):<\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2705 All Basic coverage (TPL, CDW, TP)<\\/span><\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2705 Windscreen, tyres, mirrors, locks, and glass coverage<\\/span><\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2705 Key loss, towing, and roadside recovery for non-mechanical issues<\\/span><\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2705 Vandalism and weather damage<\\/span><\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2705 Minor scratches, dents, and paintwork (subject to fair usage)<\\/span><\\/div><div><br><\\/div><div>Your responsibility:<\\/div><div>Excess is reduced or waived entirely depending on plan chosen (e.g., \\u00a30 excess option).<\\/div><div><br><\\/div><div>Important:<\\/div><div>Full Insurance does not cover unauthorised use, off-road driving, or use under the influence of drugs\\/alcohol.<\\/div><ol><li style=\\\"text-align: center; \\\"><img src=\\\"data:image\\/png;base64,iVBORw0KGgoAAAANSUhEUgAABM4AAAL2CAIAAAA2Ek34AAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAAJcEhZcwAADsMAAA7DAcdvqGQAAP+lSURBVHhe7N0FXBTpGwfw2V1i6a6lBFFsTOxu7Drb89Sz9W+cccYZd3q2nt15JraAgIWCIikp3d3Nwub\\/2X2HPSQUFfv53n3Wed95p95Z2PkxsQyxWEwhhBBCP7bi4mJFRUV5eXm6jBBCCKGPw6T\\/RQghhBBCCCGE6kn9n9UsKyvjcrk8Ho8uI4QQQp+XgoKCkpISm82my3WAZzURQgih+lWfUVMgEJSWljKZTPy0Rggh9AXx+fzy8nKRSKSsrCwnJ0fXvhVGTYQQQqh+1dsFtEKhkMvlstlsVVVV\\\\/HYbDZdrj9lyT53HrwMy+WZGugpylUJxiXRDi5PgiMKBSr6euosBl37xYjLUyMCXnr5BASnq1mYZ7y66fYyLE+RY6bNLstLeun2LCxLqGegx2bRzWsizInxfvDUKy4lU9uogbI8XftBCsNuODwLiy+X1zTQVmHUQ+eIcqNeunm+5inp6KorlaSHubk+CwjjGTUzVKIbIITQ16i8vFxRUZHxrt+D8CkmJyfHYr3tdzRCCCGE6u6LndVMf356ntRW10S6qiZFAecXgyPX00v4dNV\\/st3WrV68ePXp269KhXTVl1MScmf3\\/IWLFklWd59vnviRdMWPeqTAcU7M\\/cvrFy9aumLVs3gu3bxmgvhnZ35bunjDtr1xBXTVh0q\\/L1n+H1fdogRiuurjpDstgM1btOPK4zKBOCvEeYtk\\/vZJ9FiEEEIIIYQQ+s+Xipp5D05tvCt1ZK\\/z27LmtyItaOsee5+Y\\/C7zj\\/uFXRlmSFdLyes2tTLUVtZq2NVS72NO\\/IrKsqNdLmz7Y8XtNLqmPnDTXt48tenwucT86mG+Mp0mo1tqqepZW1rIffkzyAghhBBCCKGv2peJmrwo139dRDp6HANNDVHQP48CSurnxNuXU5yblsLlUmy2UdumhupsuTeyGNOgzejLXq+fn1\\/dXOsjQlpZ5vXNa+evPvA4kFuP3RV8acSYRX888o3hi+iaWii2n3vWJ\\/j5mjFtFfAOX4QQQgghhNB