uy_ev_incentive_included`, `rent_to_buy_ownership_transfer_notes`, `top_pick`, `ideal_for_family`, `pickup`, `dropup`, `free_cancellation`, `collision_damage_waiver`, `theft_protection`, `unlimited_mileage`, `vehicle_features`, `daily_rate_tax_incl`, `weekly_rate_tax_incl`, `monthly_rate_tax_incl`) VALUES
('a013f80b-2348-4eac-b104-1f2744544372', NULL, 'Maruti', 'Alfa Romeo', 1, 10.00, '4C', 'Coupes', '2008', 'RED', 'Automatic', 5, 'ABC1122334', NULL, NULL, NULL, NULL, NULL, '[{\"title\":\"Bluetooth\",\"price\":\"100\",\"description\":\"Bluetooth\",\"interval\":\"one_time\"},{\"title\":\"Baby sheet\",\"price\":\"100\",\"description\":\"Baby sheet\",\"interval\":\"one_time\"}]', 'Starting price of a second-hand Maruti Suzuki 800 is Rs. 45,000. Some of the used Maruti Suzuki 800 on CarWale come with a 7-day money back guarantee,', 'ABC112233', NULL, 'ABC112233', NULL, NULL, NULL, '<p>• VAT and mandatory third‑party liability. Collision Damage Waiver (CDW) and Theft Protection (TP) are included unless stated.</p><p>• Daily mileage allowance as shown on your car. Excess mileage is charged at the per‑mile/ km rate shown.</p><p>• Roadside assistance for mechanical breakdown (not driver fault).</p><div><br></div>', '[{\"level\":\"basic\",\"cover\":\"Basic Insurance\",\"cover_descr\":\"<p>What it is:<\\/p><p>Basic insurance is automatically included in your rental price. It provides the minimum level of cover required by law in the UK and Europe.<\\/p><p><br><\\/p><p>What\\u2019s covered:<\\/p><p><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2705 Third-Party Liability (TPL): covers damage or injury caused to other people, vehicles, or property while driving the hire car.<\\/span><\\/p><p><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2705 Collision Damage Waiver (CDW): limits your financial responsibility for damage to the rental vehicle, excluding tyres, glass, underbody, and interior.<\\/span><\\/p><p><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2705 Theft Protection (TP): limits your liability if the vehicle is stolen.<\\/span><\\/p><p><br><\\/p><p>What\\u2019s not covered:<\\/p><p><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u274c Damage to tyres, wheels, glass, underbody, roof, or interior.<\\/span><\\/p><p><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u274c Lost keys, misfuelling, or driver negligence.<\\/span><\\/p><p><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u274c Personal belongings.<\\/span><\\/p><p><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u274c Any damage not reported at the time of incident or caused by unauthorised use.<\\/span><\\/p><p><br><\\/p><p>Your responsibility:<\\/p><p>You remain liable up to the excess amount shown in your rental agreement (for example, \\u00a31,000\\u2013\\u00a32,500 depending on the vehicle). This means you pay up to that amount for any damage or theft, even if not your fault.<\\/p><div><br><\\/div>\",\"daily_price\":\"100\",\"excess\":\"100\"},{\"level\":\"full\",\"cover\":\"Full Insurance\",\"cover_descr\":\"<div>What it is:<\\/div><div>A comprehensive cover upgrade that significantly reduces your financial risk and offers broader protection for the vehicle.<\\/div><div><br><\\/div><div>What\\u2019s covered (in addition to Basic):<\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2705 All Basic coverage (TPL, CDW, TP)<\\/span><\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2705 Windscreen, tyres, mirrors, locks, and glass coverage<\\/span><\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2705 Key loss, towing, and roadside recovery for non-mechanical issues<\\/span><\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2705 Vandalism and weather damage<\\/span><\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2705 Minor scratches, dents, and paintwork (subject to fair usage)<\\/span><\\/div><div><br><\\/div><div>Your responsibility:<\\/div><div>Excess is reduced or waived entirely depending on plan chosen (e.g., \\u00a30 excess option).<\\/div><div><br><\\/div><div>Important:<\\/div><div>Full Insurance does not cover unauthorised use, off-road driving, or use under the influence of drugs\\/alcohol.<\\/div>\",\"daily_price\":\"100\",\"excess\":\"100\"},{\"level\":\"excess\",\"cover\":\"Excess Protection\",\"cover_descr\":\"<div>What it is:<\\/div><div>A supplemental product that reimburses you for any deductible\\/excess you may be charged if the car is damaged or stolen.<\\/div><div><br><\\/div><div>How it works:<\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>You still leave a deposit hold at pick-up.<\\/span><\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>If ANI Motors charges you part or all of your excess after damage, you can claim it back through Excess Protection.<\\/span><\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>It\\u2019s ideal for travellers who want to limit unexpected costs but keep the Basic cover.<\\/span><\\/div><div><br><\\/div><div>Covered items (depending on provider):<\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2705 Excess on damage\\/theft up to a limit (e.g. \\u00a33,000)<\\/span><\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2705 Tyres, glass, underbody, roof<\\/span><\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2705 Towing &amp; admin fees<\\/span><\\/div><div><br><\\/div><div>Not covered:<\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u274c Negligence or contract breach<\\/span><\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u274c Loss of personal items<\\/span><\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u274c Any unreported incident<\\/span><\\/div><div><br><\\/div>\",\"daily_price\":\"120\",\"excess\":\"120\"}]', '<p>• VAT and mandatory third‑party liability. Collision Damage Waiver (CDW) and Theft Protection (TP) are included unless stated.</p><p>• Daily mileage allowance as shown on your car. Excess mileage is charged at the per‑mile/ km rate shown.</p><p>• Roadside assistance for mechanical breakdown (not driver fault).</p><div><br></div>', '<p>• VAT and mandatory third‑party liability. Collision Damage Waiver (CDW) and Theft Protection (TP) are included unless