descr\":\"<div>What it is:<\\/div><div>A comprehensive cover upgrade that significantly reduces your financial risk and offers broader protection for the vehicle.<\\/div><div><br><\\/div><div>What\\u2019s covered (in addition to Basic):<\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2705 All Basic coverage (TPL, CDW, TP)<\\/span><\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2705 Windscreen, tyres, mirrors, locks, and glass coverage<\\/span><\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2705 Key loss, towing, and roadside recovery for non-mechanical issues<\\/span><\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2705 Vandalism and weather damage<\\/span><\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2705 Minor scratches, dents, and paintwork (subject to fair usage)<\\/span><\\/div><div><br><\\/div><div>Your responsibility:<\\/div><div>Excess is reduced or waived entirely depending on plan chosen (e.g., \\u00a30 excess option).<\\/div><div><br><\\/div><div>Important:<\\/div><div>Full Insurance does not cover unauthorised use, off-road driving, or use under the influence of drugs\\/alcohol.<\\/div>\",\"daily_price\":\"150\",\"excess\":\"150\"},{\"level\":\"excess\",\"cover\":\"Excess Protection\",\"cover_descr\":\"<div>What it is:<\\/div><div>A supplemental product that reimburses you for any deductible\\/excess you may be charged if the car is damaged or stolen.<\\/div><div><br><\\/div><div>How it works:<\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>You still leave a deposit hold at pick-up.<\\/span><\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>If ANI Motors charges you part or all of your excess after damage, you can claim it back through Excess Protection.<\\/span><\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>It\\u2019s ideal for travellers who want to limit unexpected costs but keep the Basic cover.<\\/span><\\/div><div><br><\\/div><div>Covered items (depending on provider):<\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2705 Excess on damage\\/theft up to a limit (e.g. \\u00a33,000)<\\/span><\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2705 Tyres, glass, underbody, roof<\\/span><\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2705 Towing &amp; admin fees<\\/span><\\/div><div><br><\\/div><div>Not covered:<\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u274c Negligence or contract breach<\\/span><\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u274c Loss of personal items<\\/span><\\/div><div><span style=\\\"white-space: normal;\\\"><span style=\\\"white-space:pre\\\">\\t<\\/span>\\u2022<span style=\\\"white-space:pre\\\">\\t<\\/span>\\u274c Any unreported incident<\\/span><\\/div>\",\"daily_price\":\"150\",\"excess\":\"150\"}]', '<p>ANI MOTORS – CAR HIRE TERMS &amp; CONDITIONS (v1.0, 2025-10-06)</p><p><br></p><p>1) Who you contract with</p><p>You are booking with ANI Motors Ltd (“we/us”). When you pay on booking, you are paying ANI Motors as merchant of record. When you pay at pick-up, a pre-authorisation (“deposit hold”) is placed on your card.</p><p><br></p><p>2) Driver requirements</p><p>• Minimum age and licence tenure per car class (see listing). Under- or over‑age fees may apply.</p><p>• Valid full driving licence held for the minimum months shown; International Driving Permit if required.</p><p>• Primary driver must present the payment card used to place the deposit hold, and a government photo ID/passport.</p><p>• Additional drivers must be present with their licences; fees may apply per day.</p><p><br></p><p>3) What your price includes</p><p>• VAT and mandatory third‑party liability. Collision Damage Waiver (CDW) and Theft Protection (TP) are included unless stated.</p><p>• Daily mileage allowance as shown on your car. Excess mileage is charged at the per‑mile/ km rate shown.</p><p>• Roadside assistance for mechanical breakdown (not driver fault).</p><p><br></p><p>4) What’s not included</p><p>• Fuel/charging costs (see Fuel/Battery policy), road/bridge/tunnel tolls, congestion/ULEZ charges, parking charges, traffic/PCN fines, speeding fines, and related admin fees (£30 per PCN).</p><p>• Damage or breakdown due to driver negligence (e.g., misfueling, curb/tyre damage, interior damage, off‑road use) and any key/charging cable loss.</p><p>• Optional extras (child seats, GPS, additional driver, cross‑border, out‑of‑hours, young driver fees) as listed on the car page.</p><p><br></p><p>5) Deposit &amp; excess</p><p>• A refundable security deposit hold is taken at pick-up on a credit card in the main driver’s name. We accept major credit/debit cards; cash not accepted.</p><p>• In case of damage/theft, the customer is liable up to the excess shown on the listing unless reduced by purchasing optional excess protection (if offered).</p><p><br></p><p>6) Identification &amp; payment</p><p>• Bring the same card you used for the booking (or an equivalent card in the main driver’s name). Virtual/ prepaid cards may be refused for deposits.</p><p>• We may require proof of address (utility bill/bank statement &lt; 90 days) for UK residents.</p><p><br></p><p>7) Mileage policy</p><p>• Each car has a daily mileage limit; unused miles do not roll over. Excess mileage is charged at the per‑mile rate on return.</p><p><br></p><p>8) Fuel / Battery policy</p><p>• “Full‑to‑Full”: pick up full, return full. Missing fuel is charged at pump price + £0.50/litre service.</p><p>• EVs must be returned with at least 60% battery (unless otherwise shown). Top‑up fee £0.50 per % below threshold + any DC charging cost.</p><p><br></p><p>9) Grace period &amp; late returns</p><p>• Grace period is as shown (typically 29 minutes). After that, late return fee per started hour applies. Returns &gt; 3 hours late may be charged as an extra rental day at the day rate + fees.</p><p><br></p><p>10) Cleanliness &amp; smoking</p><p>• No smoking or vaping. Excessive dirt, sand, pet hair or odour may incur a cleaning fee as shown on the listing.</p><p><br></p><p>11) Cross‑border travel</p><p>• Only permitted if the listing states “cross-border allowed” and the fee is paid. Written prior approval is required. Some countries are excluded.</p><p><br></p><p>12) Cancellation / no‑show policy</p><p>• Flexible: free cancellation until the “free cancellation until hours” shown before pick‑up; after that, 1 rental day is charged.</p><p>• Semi‑Flexible: free cancellation until the hours shown; after that, 50% of the rental is charged.</p><p>• Non‑Refundable: 100% charged on booking; no refund on cancellation or no‑show.</p><p>• No‑show: if you fail to arrive with required documents/ card within 2 hours of pick‑up time, the booking may be cancelled and charges per plan apply.</p><p><br></p><p>13) Modifications</p><p>• Changes are subject to availability and may affect the price. If the change reduces the rental value, standard cancellation charges may apply to the unused portion.</p><p><br></p><p>14) Fines, PCNs &amp; administration</p><p>• You are responsible for all traffic/parking offences. We will transfer liability where possible and charge a £30 admin fee per notice. For tolls we may charge the toll + admin fee.</p><p><br></p><p>15) Accidents &amp; incidents</p><p>• In any incident: stop safely; call emergency services if needed; report to us immediately; do not admit liability; obtain third‑party details and photos. A full report must be submitted within 24 hours.</p><p>• Failure to report may void cover and you may be liable for full costs.</p><p><br></p><p>16) Breakdown</p><p>• Call the provided roadside number. Call‑out caused by driver error (e.g., keys locked in, out of charge/fuel, flat battery due to accessories) is chargeable at cost.</p><p><br></p><p>17) Vehicle use restrictions</p><p>• No off‑road use, track days, towing (unless authorised), or ride‑hailing/ courier work unless authorised in writing. Commercial/private‑hire use requires prior approval and appropriate insurance.</p><p><br></p><p>18) Vehicle condition</p><p>• A condition report is completed at pick‑up/return with time-stamped photos. Unreported damage will be deemed new. Tyres, wheels, windscreen, glass and interior are not fully covered by CDW unless stated.</p><p><br></p><p>19) Privacy &amp; telematics</p><p>• Vehicles may be fitted with telematics, GPS and immobilisers for security and safety. By hiring you consent to reasonable use of such data for insurance, safety, fraud prevention and operational purposes, in line with our Privacy Notice.</p><p><br></p><p>20) Jurisdiction</p><p>• These Terms are governed by the laws of England &amp; Wales. Consumer rights remain unaffected.</p><p><br></p><p>Contact</p><p>ANI Motors Ltd • Office 7, Albion House, 6 Albion Close, Slough, SL2 5DT • info@animotor.co.uk • +44 7447 574861</p>', '<p><span style=\"color: rgb(26, 26, 26); font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif;\">If the car\'s bodywork gets damaged, the most you\'ll pay towards repairs covered by the Collision Damage Waiver is the damage excess (</span><span style=\"color: rgb(26, 26, 26); font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif;\">£1,505.00</span><span style=\"color: rgb(26, 26, 26); font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif;\">).</span><span style=\"color: rgb(26, 26, 26); font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif;\">This cover is only valid if you stick to the terms of the rental agreement. It doesn\'t cover other parts of the car (e.g. windows, wheels, interior or undercarriage), or charges (e.g. for towing or off-road time), or anything in the car (e.g. child seats, GPS devices or personal belongings).</span></p>', '<div class=\"PM_b8de4613\" style=\"box-sizing: inherit; flex-shrink: 0; margin-block: 0px; margin-inline: 0px; line-height: 20px; font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif; color: rgb(26, 26, 26);\">At pick-up, the main driver will leave a refundable security deposit of&nbsp;£1,505.00&nbsp;on their&nbsp;credit card. Cash and debit cards are not accepted. The counter staff will confirm how much this will be.</div><div style=\"box-sizing: inherit; flex-shrink: 0; margin-block: 0px; margin-inline: 0px; color: rgb(26, 26, 26); font-family: BlinkMacSystemFont, -apple-system, &quot;Segoe UI&quot;, Roboto, Helvetica, Arial, sans-serif;\"><h4 class=\"PM_f48a68a6\" style=\"box-sizing: inherit