INSERT INTO `page_contents` (`id`, `page_id`, `level`, `is_shortcode`, `is_active`, `content`, `title`, `created_at`, `updated_at`) VALUES
('99e98d8c-51f4-4daa-b976-774a6b8e9eae', '99bb306b-96c0-44e9-9dee-71cbc0cd17b1', 1, 1, 1, 'frontpage.components.home_booking', 'Booking', '2023-08-17 20:20:12', '2023-08-17 20:21:52'),
('9a2a2e79-6773-4696-a30e-9cb24cdf5948', '99bb306b-98d4-4258-98a5-7a9ee16aeef9', 1, 0, 1, '<!--content-->\r\n<section class=\"section privacy-section pt-120 pb-120\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-12\">\r\n<div class=\"terms-policy\">\r\n<h4 class=\"text-center\">About Us</h4><p><br></p>\r\n<p data-aos=\"fade-down\" style=\"text-align: center; \"><span style=\"font-size: 14px;\">ANI Motors is a renowned car hire company based in Slough, United Kingdom, established in 2016. With a strong presence in the industry, ANI Motors has excelled in providing top-notch car rental services to customers. What sets ANI Motors apart is its innovative approach, as it has created a unique marketplace for other car hire firms to showcase their vehicles to potential customers.</span></p><p data-aos=\"fade-down\"><br></p><p data-aos=\"fade-down\" style=\"text-align: center; \"><span style=\"font-size: 14px;\">ANI Motors takes pride in its advanced fleet management systems, which streamline the rental process. These systems include digital hire agreements and digital signatures, ensuring a seamless and efficient experience for both renters and the company. To further enhance customer satisfaction, ANI Motors has implemented a vehicle defect reporting system, allowing renters to easily report any issues they encounter during their rental period.</span></p><p data-aos=\"fade-down\"><br></p><p data-aos=\"fade-down\" style=\"text-align: center; \"><span style=\"font-size: 14px;\">Recognizing the importance of effective communication, ANI Motors offers live web chat support, enabling customers to receive real-time assistance and prompt solutions to their queries. Additionally, ANI Motors has introduced the Kwikbooking mobile app, a convenient marketplace that connects users with garages, car washes, and tire shops. This app simplifies the process of finding and booking these services, enhancing the overall experience for car owners.</span></p><p data-aos=\"fade-down\"><br></p><p data-aos=\"fade-down\" style=\"text-align: center; \"><span style=\"font-size: 14px;\">With its commitment to innovation, customer satisfaction, and technologically driven solutions, ANI Motors continues to revolutionize the car hire industry in the United Kingdom</span></p>\r\n</div><span style=\"font-size: 14px;\">\r\n</span></div><span style=\"font-size: 14px;\">\r\n</span></div><span style=\"font-size: 14px;\">\r\n</span></div><span style=\"font-size: 14px;\">\r\n</span></section><span style=\"font-size: 14px;\">\r\n</span>', 'Content', '2023-09-18 23:23:10', '2023-09-18 23:30:48'),
('9a2a372c-e0bb-40af-9359-7bf716653e1d', '99bb306b-96c0-44e9-9dee-71cbc0cd17b1', 1, 0, 1, '<section class=\"cars__ticket pb-120 pb__10\">\r\n    <div class=\"container\">\r\n        <div class=\"row align-items-center justify-content-center\">\r\n            <div class=\"col-md-8 col-sm-12\">\r\n                <div class=\"train__ticket__content car__ticket__content\">\r\n                    <div class=\"section__header mb__30 wow fadeInDown\">\r\n                        <h5 class=\"text-center\">\r\n                            What do we do?\r\n                        </h5>\r\n                        <p class=\"text-center\">\r\n                            Save time and money by finding the very best car hire deal for your trip, today.\r\n                            We bring the biggest and best car hire companies together one a single website, so one search gives you access to the best prices you can get for the car hire you need. Whatever the vehicle, wherever you are, we are your one stop shop for the best car hire deals today and every day. With exclusive discounts adding even more value, you can have confidence that car hire from Animotors is the best value anywhere, and with our\r\n                                support team ready to help, you get that value while enjoying the best service too.</p><p class=\"text-center\"><br></p><p class=\"text-center\"><br></p><p class=\"text-center\">\r\n                        </p>\r\n\r\n                        <h5 class=\"text-center\">\r\n                            How it Works\r\n                        </h5>\r\n\r\n                        <p class=\"text-center\">\r\n                            Just enter the pickup location where you want to hire a car\r\n                            from and the dates you want the vehicle, then select from the range of\r\n                            vehicles available. It really is that easy, and because we offer the best deals from the biggest names in car hire,\r\n                            you can be confident you have the best deal, every time.</p><p class=\"text-center\"><br></p><p class=\"text-center\"><br></p><p class=\"text-center\"><br></p><p class=\"text-center\">\r\n                        </p>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</section>', 'Content', '2023-09-18 23:47:29', '2023-09-19 11:39:46'),
('9a2a4fa9-c64d-4fdf-892b-7007bb89e721', '99bb306b-9907-4b33-9f4f-ed9d8d892dc4', 1, 1, 1, 'frontpage.components.contact_form', 'Shortcode', '2023-09-19 00:55:58', '2023-09-19 00:57:36'),
('9a46371d-daf2-4934-8dcb-7aacd23ae6b5', '99bb306b-985e-4e00-b6b3-0492a8c9421b', 1, 0, 1, '<!--content-->\r\n<section class=\"section privacy-section pt-120 pb-120\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-12\">\r\n<div class=\"terms-policy\">\r\n<h4 class=\"text-center\">ANI Motors Privacy Policy</h4><p><br></p>\r\n<p data-aos=\"fade-down\" style=\"text-align: center; \"><span style=\"font-size: 14px;\">\"We consider your privacy to be of utmost importance. As such, we have developed this policy to ensure that you understand how we collect, use, share, and disclose personal information. The following outlines our privacy policy. Before or at the time we collect personal information, we will clearly state the reasons for gathering it.</span></p><p data-aos=\"fade-down\" style=\"text-align: center; \"><span style=\"font-size: 14px;\">We will collect and use personal information solely for the purposes we have specified and for other legitimate reasons, either with the individual\'s consent or as required by law. We will retain personal information only as long as necessary to fulfill these purposes. We will collect personal information through legal and fair means, and where applicable, with the individual\'s knowledge or consent. Personal information should be relevant to the purposes for which it will be used and, to the extent required for those purposes, accurate, complete, and up-to-date.</span></p><p data-aos=\"fade-down\" style=\"text-align: center; \"><span style=\"font-size: 14px;\">We will safeguard personal information through security measures to prevent loss or theft, as well as unauthorized access, disclosure, copying, use, or alteration. We will promptly provide individuals with access to our policies and procedures for managing personal data. We are committed to conducting our business in accordance with these principles to ensure the security and integrity of personal data.\"</span></p>\r\n</div><span style=\"font-size: 14px;\">\r\n</span></div><span style=\"font-size: 14px;\">\r\n</span></div><span style=\"font-size: 14px;\">\r\n</span></div><span style=\"font-size: 14px;\">\r\n</span></section><span style=\"font-size: 14px;\">\r\n</span>', 'Content', '2023-10-02 21:50:30', '2023-10-02 21:54:04'),
('9a463957-5cd1-465d-b663-bb6a45766a9a', '99bb306b-989c-4d78-9ea9-7b41adb55427', 1, 0, 1, '<!--content-->\r\n<section class=\"section privacy-section pt-120 pb-120\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-12\">\r\n<div class=\"terms-policy\">\r\n<h4 class=\"text-center\">ANI Motors Terms &amp; Condition</h4><p><br></p>\r\n<p data-aos=\"fade-down\" style=\"text-align: left;\"><span style=\"font-size: 14px;\"><b>1. **Usage Terms**</b></span></p><p data-aos=\"fade-down\" style=\"text-align: left;\"><span style=\"font-size: 14px;\">When you use this website, you agree to comply with the terms and conditions outlined below, as well as all applicable laws and regulations. If you do not agree with any of these terms and conditions, you are not permitted to use or access this site. The materials on this site are protected by relevant copyright and trademark laws.</span></p><p data-aos=\"fade-down\" style=\"text-align: left;\"><span style=\"font-size: 14px;\"><br></span></p><p data-aos=\"fade-down\" style=\"text-align: left;\"><span style=\"font-size: 14px;\"><b>2. **License for Use**</b></span></p><p data-aos=\"fade-down\" style=\"text-align: left;\"><span style=\"font-size: 14px;\">You are granted permission to temporarily download one copy of the materials (data or software) from the ANI MOTORS LTD website for personal, non-commercial use only. This is a limited license and does not transfer ownership. Under this license, you may not: modify or duplicate the materials; use the materials for any commercial purpose or public display (commercial or non-commercial); attempt to decompile or reconstruct any software or material contained on the ANI MOTORS LTD site; remove any copyright or other proprietary notations from the materials; or transfer the materials to another person or \"mirror\" the materials on another server. This license may be terminated if you violate any of these restrictions and may be terminated by ANI MOTORS LTD at any