es, these limitations may not apply to you.</span></p><p data-aos=\"fade-down\" style=\"text-align: left;\"><span style=\"font-size: 14px;\"><br></span></p><p data-aos=\"fade-down\" style=\"text-align: left;\"><span style=\"font-size: 14px;\"><b>5. **Changes and Corrections**</b></span></p><p data-aos=\"fade-down\" style=\"text-align: left;\"><span style=\"font-size: 14px;\">The materials on the ANI MOTORS LTD site may contain typographical or photographic errors. ANI MOTORS LTD does not warrant that any of the materials on its site are accurate, complete, or current. ANI MOTORS LTD may make changes to the materials contained on its site at any time without notice. However, ANI MOTORS LTD does not commit to updating the materials.</span></p><p data-aos=\"fade-down\" style=\"text-align: left;\"><span style=\"font-size: 14px;\"><br></span></p><p data-aos=\"fade-down\" style=\"text-align: left;\"><span style=\"font-size: 14px;\"><b>6. **Links**</b></span></p><p data-aos=\"fade-down\" style=\"text-align: left;\"><span style=\"font-size: 14px;\">ANI MOTORS LTD has not reviewed all of the websites or links connected to its website and is not responsible for the content of any linked site. Inclusion of any link does not imply endorsement by ANI MOTORS LTD of the site. Use of any linked site is at the user\'s own risk.</span></p><p data-aos=\"fade-down\" style=\"text-align: left;\"><span style=\"font-size: 14px;\"><br></span></p><p data-aos=\"fade-down\" style=\"text-align: left;\"><span style=\"font-size: 14px;\"><b>7. **Modifications to Terms of Use**</b></span></p><p data-aos=\"fade-down\" style=\"text-align: left;\"><span style=\"font-size: 14px;\">ANI MOTORS LTD may revise these terms of use for its website at any time without notice. By using this site, you agree to be bound by the current version of these Terms and Conditions of Use.</span></p><p data-aos=\"fade-down\" style=\"text-align: left;\"><span style=\"font-size: 14px;\"><br></span></p><p data-aos=\"fade-down\" style=\"text-align: left;\"><span style=\"font-size: 14px;\"><b>8. **Governing Law**</b></span></p><p data-aos=\"fade-down\" style=\"text-align: left;\"><span style=\"font-size: 14px;\">Any dispute related to the ANI MOTORS LTD site shall be governed by the laws of the country of India, ANI MOTORS LTD State, without regard to its conflict of law provisions. These are the General Terms and Conditions applicable to the use of a website.</span></p><div style=\"text-align: left;\"><br></div>\r\n</div><span style=\"font-size: 14px;\">\r\n</span></div><span style=\"font-size: 14px;\">\r\n</span></div><span style=\"font-size: 14px;\">\r\n</span></div><span style=\"font-size: 14px;\">\r\n</span></section><span style=\"font-size: 14px;\">\r\n</span>', 'Content', '2023-10-02 21:56:44', '2023-10-02 21:58:43'),
('9b383e7c-51f2-4b0e-90a9-1d7b7af23e69', '9b383e4f-1dae-497c-8e78-d9061a965ec3', 1, 0, 1, '<!--<title>content</title>-->\r\n<section class=\"section privacy-section\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-12\">\r\n<div class=\"terms-policy\">\r\n<p data-aos=\"fade-down\">Welcome to the Careers page at ANI MOTORS, where we are pioneering advancements in fleet management and car booking applications. Our commitment to excellence and innovation has positioned us as leaders in the transportation industry. If you are an individual dedicated to making a meaningful impact, possessing a fervor for technological advancements, and seeking to be an integral part of a dynamic team, we invite you to explore the exciting career opportunities available with us.</p><p data-aos=\"fade-down\"><br></p><p data-aos=\"fade-down\">**Why Consider a Career at ANI MOTORS**</p><p data-aos=\"fade-down\"><br></p><p data-aos=\"fade-down\">**1. Impactful Contributions:** Join a company at the forefront of transforming how individuals and businesses manage their fleets and book transportation services.</p><p data-aos=\"fade-down\"><br></p><p data-aos=\"fade-down\">**2. Culture of Innovation:** Become a part of a culture that prizes continuous innovation, where your ideas are valued, and you have the chance to contribute to cutting-edge solutions.</p><p data-aos=\"fade-down\"><br></p><p data-aos=\"fade-down\">**3. Collaborative Work Environment:** Join a diverse and collaborative team that promotes creativity, learning, and professional growth. Our emphasis on teamwork is integral to achieving success.</p><p data-aos=\"fade-down\"><br></p><p data-aos=\"fade-down\">**4. Professional Development:** We are committed to investing in our employees\' professional growth by offering training, mentorship, and opportunities for career advancement within the organization.</p><p data-aos=\"fade-down\"><br></p><p data-aos=\"fade-down\">**Current Job Openings:**</p><p data-aos=\"fade-down\"><br></p><p data-aos=\"fade-down\">* **Software Test Engineer:** Play a pivotal role in the development and enhancement of our fleet management and car booking applications. Bring your testing&nbsp; proficiency and dedication to creating scalable, user-friendly solutions.</p><p data-aos=\"fade-down\"><br></p><p data-aos=\"fade-down\">* **Product Managers:** Drive the vision and strategy of our products, collaborating with cross-functional teams to deliver features that exceed customer expectations.</p><p data-aos=\"fade-down\"><br></p><p data-aos=\"fade-down\">* **Sales and Business Development:** Contribute to our expansion by driving sales, forming strategic partnerships, and identifying new business opportunities.</p><p data-aos=\"fade-down\"><br></p><p data-aos=\"fade-down\">* **UX/UI Designers:** Shape the user experience and interface of our applications, ensuring they are intuitive, visually appealing, and aligned with industry best practices.</p><p data-aos=\"fade-down\"><br></p><p data-aos=\"fade-down\">**How to Apply:**</p><p data-aos=\"fade-down\"><br></p><p data-aos=\"fade-down\">If you are enthused about the future of transportation, excel in a collaborative environment, and are ready to make a significant contribution, we welcome your application. Explore our current job openings and submit your application through email @ muhammad.shoukat@animotor.co.uk</p><p data-aos=\"fade-down\"><br></p><p data-aos=\"fade-down\">ANI MOTORS is an equal opportunity employer, dedicated to fostering an inclusive and diverse workplace. We encourage applications from candidates of all backgrounds.</p><p data-aos=\"fade-down\"><br></p><p data-aos=\"fade-down\">Embark on the journey with us to redefine the future of fleet management and car booking. Together, let\'s drive innovation and shape the way people move!</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>', 'Content', '2024-01-31 12:21:28', '2024-01-31 12:24:59'),
('9ecb0f51-74ee-4f56-aa30-3662881171bd', '99bb306b-9907-4b33-9f4f-ed9d8d892dc4', 1, 0, 1, '<!--<title>content</title>-->\r\n<section class=\"section privacy-section\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-12\">\r\n<div class=\"terms-policy\">\r\n<p data-start=\"200\" data-end=\"235\"><strong data-start=\"200\" data-end=\"235\">We’re Here to Drive You Forward</strong></p><p data-start=\"237\" data-end=\"450\">At <strong data-start=\"240\" data-end=\"254\">ANI Motors</strong>, your comfort, safety, and convenience are our top priorities. Whether you need a private car hire for business, leisure, airport transfers, or special events — we’re just a message or call away.</p><p data-start=\"452\" data-end=\"555\">Have a question about our services? Need help with a booking? Our friendly team is ready to assist you.</p><hr data-start=\"557\" data-end=\"560\"><h3 data-start=\"562\" data-end=\"581\">📬 Get in Touch</h3><p data-start=\"583\" data-end=\"674\"><strong data-start=\"583\" data-end=\"598\">📍 Address:</strong><br data-start=\"615\" data-end=\"618\"></p><p data-start=\"583\" data-end=\"674\">Office 13, Sheepbridge Business Centre&nbsp;</p><p data-start=\"583\" data-end=\"674\">655 Sheffield Road</p><p data-start=\"583\" data-end=\"674\">Chesterfield&nbsp;</p><p data-start=\"583\" data-end=\"674\">S41 9ED</p><p data-start=\"583\" data-end=\"674\"><font color=\"#ffffff\">S41 9LT</font></p><p data-start=\"583\" data-end=\"674\">Derbyshire, UK</p><p data-start=\"676\" data-end=\"748\"><strong data-start=\"676\" data-end=\"689\">📞 Phone:</strong><br data-start=\"689\" data-end=\"692\">+441753424350<span style=\"font-size: 1rem;\">&nbsp;</span></p><p data-start=\"750\" data-end=\"786\"><strong data-start=\"750\" data-end=\"763\">📧 Email:</strong><br data-start=\"763\" data-end=\"766\">\r\n<a data-start=\"766\" data-end=\"786\" class=\"cursor-pointer\" rel=\"noopener\">info@animotors.co.uk</a></p><p data-aos=\"fade-down\">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p data-start=\"788\" data-end=\"847\"><strong data-start=\"788\" data-end=\"809\">🕒 Working Hours:</strong><br data-start=\"809\" data-end=\"812\">\r\nMonday – Friday: 9:00 AM – 5:00 PM</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>', 'Content', '2025-04-30 06:32:05', '2025-07-30 02:46:14');
